script: |
  super -f text -I q10234.spq | sort > q10234.out

inputs:
  - name: q10234.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + 98 NOT BETWEEN 55 + + 89 * + + col2 + + CAST ( col0 AS INTEGER ) AND - 32;
  - name: tab1

outputs:
  - name: q10234.out
    data: |
      51	14	96
      85	5	59
      91	47	68
